    "quota_set": {
        "id": "30032cae7b864e5aad58
        "instances": {
            "reserved": 0,
            "limit": 10,
            "in_use": 0
        },
        "cores": {
            "reserved": 0,
            "limit": 20,
            "in_use": 0
        },
        "ram": {
            "reserved": 0,
            "limit": 51200,
            "in_use": 0
