            "in_use": 0
        },
        "security_group_rules": {
            "reserved": 0,
            "limit": 20,
            "in_use": 0
        }
    }
}

Partially implements blueprint nova-api-attribute-test

Change-Id: I3730cde95f6ffea75e3329aed4d13d3bb6cc765b

